import './App.css';
import {Landing, Home, Form} from './Views/index'
import { Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Route exact path='/'><Landing/></Route>
      <Route exact path='/home'><Home/></Route>
      <Route exact path='/form'><Form/></Route>
    </div>
  );
}

export default App;
